        <div className="film">
                {movies.map((movie) => (
                <iframe 
                    id="bestIframeEver" 
                    title='video' 
                    src={`${film_url}${movie.id}`} 
                    width="25%" height="160">
                </iframe>
                ))}
        </div>
        
    );
                }

  
